import { Formik, Form, Field } from 'formik';

export const ContactForm = () => {
  return (
    <div>
      <Formik>
        <Form>
          <label htmlFor="name"></label>
          <Field type="text" name="name" placeholder="Name" />
          <label htmlFor="name"></label>
          <Field type="text" name="name" placeholder="Name" />
        </Form>
      </Formik>
    </div>
  );
};
